import { Box } from '@mantine/core'
import React from 'react'

const Layout2 = ({ selected, setSelected }) => {
  return (
    <Box bg="gray.3" h={200}>
        <Box></Box>
         {selected && <p>{selected}</p>}
    </Box>
  )
}

export default Layout2
